import React from "react";

import { useSelector } from "react-redux";

const Cart = () => {
  const productCart = useSelector((state) => state.cart);
  return (
    <>
      <h1>Cart</h1>
      {JSON.stringify(productCart)});
    </>
  );
};

export default Cart;
